const express = require('express');
const cors = require('cors');

const app = express();
app.use(cors());

app.get('/recipes', (req, res, next) => {
  const recipes = [
    { id: "0" ,
      name: "Rice",
      description: "A healthy choice!",
      imagePath: "data:image/jpeg;base64," ,
      ingredients: [{ name: 'Rice' , amount: 6 }] },
    { id: "1",
      name: "Pizza",
      description: "Everybody knows it",
      imagePath: "data:image/jpeg;base64," ,
      ingredients: [{ name: 'Bread' , amount: 6 } , { name: 'Cheese', amount: 12 }] }
  ];

  res.status(200).json({
    message: "Success",
    recipes: recipes
  });

});

module.exports = app;

